function toggleSection(id) {
    hideActiveNavigationItem();
    setNavigationItemActive(id);
    hideActiveSection();
    showSection(id);
    window.location.hash = id;
}

function hideActiveNavigationItem() {
    let activeNavigationItem = document.querySelector(
        `.${CSS_CLASSLIST.navigationBar.item.active}`
    );
    if (activeNavigationItem)
        activeNavigationItem.classList.remove(
            CSS_CLASSLIST.navigationBar.item.active
        );
}

function setNavigationItemActive(id) {
    let navigationItem = document.querySelector(
        `[data-referenced-section-id="${id}"]`
    );
    if (!navigationItem)
        throw new Error(
            `Navigation item with referenced section ID (${id}) does not exist.`
        );
    navigationItem.classList.add(CSS_CLASSLIST.navigationBar.item.active);
}

function hideActiveSection() {
    const activeSection = document.querySelector(".page-section--active");
    if (activeSection) activeSection.classList.remove("page-section--active");
}

function showSection(id) {
    const section = document.querySelector(`.page-section#${id}`);
    if (!section) throw new Error(`Section ID (${id}) does not exists.`);
    section.classList.add("page-section--active");
}

function closeNavigationBar() {
    navigationBar.classList.remove("navigation-bar--opened");
}

function applyZoom(scale) {
    currentScale = scale;
    zoomGroup.setAttribute("transform", `scale(${currentScale})`);
}

function loadData() {
    loadTables();
    loadCategories();
    loadItems();
    loadOrders();
}

function loadTables() {
    fetch(ENDPOINT.table.query, {
        method: "GET",
        headers: {
            "Content-Type": "application/json",
        },
    })
        .then((response) => response.json())
        .then((data) => {
            if (data.status !== "ok") throw new Error(data.message);

            const tableDistributionSection = document.querySelector(
                `.page-section#${SECTION_ID.tableDistribution}`
            );
            const results = tableDistributionSection.querySelector(
                ".page-section__results"
            );
            const resultsTableBody = results.querySelector(`.table__body`);

            document.querySelectorAll(".map__table-group").forEach(tableGroup => {
              tableGroup.remove();
            })

            // Remove current table content
            resultsTableBody.innerHTML = "";

            // Check if there are tables
            if (data.tables.length > 0) {
                tables = data.tables;
                results.classList.remove("page-section__results--no-results");
                let guests = [];
                data.tables.forEach((table) => {
                    loadTable(table);

                    if (guests.indexOf(table.max_guests) === -1) {
                        guests.push(table.max_guests);
                    }
                });

                tableFilters_maxGuests.innerHTML =
                    "<option value=''>Any</option>";
                guests.sort().forEach((guest) => {
                    const option = document.createElement("option");
                    option.setAttribute("value", guest);
                    option.textContent = guest;
                    tableFilters_maxGuests.appendChild(option);
                });
            } else {
                results.classList.add("page-section__results--no-results");
            }
        })
        .catch((errorMsg) => {
            console.error(errorMsg);
            error("Tables could not be loaded");
        });
}

function loadTable(tableData) {
    addTableToMap(tableData);
    addTableToTable(tableData);
}

function addTableToMap(tableData) {
    // Define elements
    const group = document.createElementNS("http://www.w3.org/2000/svg", "g");
    const rect = document.createElementNS("http://www.w3.org/2000/svg", "rect");
    const tableId = document.createElementNS(
        "http://www.w3.org/2000/svg",
        "text"
    );
    const handle = document.createElementNS(
        "http://www.w3.org/2000/svg",
        "circle"
    );

    // Set attributes
    group.setAttribute("class", "map__table-group");
    group.setAttribute("data-id", tableData.id);

    rect.setAttribute("class", `map__table map__table--${tableData.status}`);
    rect.setAttribute("x", tableData.data.x);
    rect.setAttribute("y", tableData.data.y);
    rect.setAttribute("width", tableData.data.width);
    rect.setAttribute("height", tableData.data.height);

    tableId.classList.add("map__table-id");
    tableId.setAttribute(
        "x",
        Math.floor(tableData.data.width / 2) + parseInt(tableData.data.x)
    );
    tableId.setAttribute(
        "y",
        Math.floor(tableData.data.height / 2) + parseInt(tableData.data.y)
    );
    tableId.setAttribute("text-anchor", "middle");
    tableId.setAttribute("dominant-baseline", "middle");
    tableId.setAttribute("font-size", "40px");
    tableId.setAttribute("font-weight", "bold");
    tableId.setAttribute("fill", "black");

    handle.setAttribute("class", "handle");
    handle.setAttribute("cx", tableData.handle.cx);
    handle.setAttribute("cy", tableData.handle.cy);
    handle.setAttribute("r", tableData.handle.r);

    // Set text content
    tableId.textContent = tableData.id;

    // Append child nodes
    zoomGroup.appendChild(group);
    group.appendChild(rect);
    group.appendChild(tableId);
    group.appendChild(handle);
}

