function addCategoryToTable(category) {
    // Link, define elements
    const tableData = categoriesSection.querySelector(".table__body");
    const row = document.createElement("tr");
    const nameCell = document.createElement("td");
    const actionsCell = document.createElement("td");
    const actionOptions = document.createElement("div");
    const seeButton = document.createElement("button");
    const seeIcon = document.createElement("i");
    const editButton = document.createElement("button");
    const editIcon = document.createElement("i");
    const removeButton = document.createElement("button");
    const removeIcon = document.createElement("i");

    // Set attribute
    row.setAttribute("class", "table__row");
    row.setAttribute("data-id", category.id);
    row.setAttribute("data-category-name", category.name);

    nameCell.setAttribute("class", "table__cell");
    nameCell.setAttribute("data-table-element", "name");

    actionsCell.setAttribute("class", "table__cell");
    actionOptions.setAttribute("class", "table__cell-options");

    seeButton.setAttribute(
        "class",
        "table__button table__button--see-category"
    );
    seeButton.setAttribute("type", "button");
    seeButton.setAttribute("aria-label", `See details`);

    seeIcon.setAttribute("class", "table__icon ti ti-eye");

    editButton.setAttribute(
        "class",
        "table__button table__button--edit-category"
    );
    editButton.setAttribute("type", "button");
    editButton.setAttribute("aria-label", "Edit data");

    editIcon.setAttribute("class", "table__icon ti ti-pencil");

    removeButton.setAttribute(
        "class",
        "table__button table__button--remove-category"
    );
    removeButton.setAttribute("type", "button");
    removeButton.setAttribute("aria-label", "Remove category");

    removeIcon.setAttribute("class", "table__icon ti ti-category-minus");

    // Set text content
    nameCell.textContent = capitalize(category.name);

    // Append child nodes
    tableData.appendChild(row);

    row.appendChild(nameCell);
    row.appendChild(actionsCell);

    actionsCell.appendChild(actionOptions);

    actionOptions.appendChild(seeButton);
    actionOptions.appendChild(editButton);
    actionOptions.appendChild(removeButton);

    seeButton.appendChild(seeIcon);
    editButton.appendChild(editIcon);
    removeButton.appendChild(removeIcon);

    // Add event listeners
    seeButton.addEventListener("click", () => {
        const modal = document.querySelector(
            `[data-element="category-management"][data-category-id="${category.id}"]`
        );
        const mode = "show";

        if (modal) {
            modal.classList.add("modal--active");
            modal.querySelector(".modal__form").setAttribute("data-mode", mode);
        } else {
            addCategoryManagementModal(category, mode);
        }
    });
    editButton.addEventListener("click", () => {
        const modal = document.querySelector(
            `[data-element="category-management"][data-category-id="${category.id}"]`
        );
        const mode = "edit";

        if (modal) {
            modal.classList.add("modal--active");
            modal.querySelector(".modal__form").setAttribute("data-mode", mode);
        } else {
            addCategoryManagementModal(category, mode);
        }
    });
    removeButton.addEventListener("click", () => {
        let removed = false;
        for (let i = 0; i < categories.length && !removed; i++) {
            if (categories[i].id === category.id) {
                categories.splice(i, 1);
                removed = true;
            }
        }

        row.remove();
        applyCategoryFilters();

        fetch(ENDPOINT.category.remove, {
            method: "POST",
            headers: {
                "Content-Type": "application/json",
            },
            body: JSON.stringify(category),
        })
            .then((data) => data.json())
            .then((response) => {
                if (response.status !== "ok") throw new Error(response.message);
                info(response.message);
            })
            .catch((errorMsg) => {
                console.error(errorMsg);
                error("Category could not be deleted");
            });
    });
}

