function loadItems() {
    fetch(ENDPOINT.item.query, {
        method: "GET",
        headers: {
            "Content-Type": "application/json",
        },
    })
        .then((data) => data.json())
        .then((response) => {
            if (response.status !== "ok") throw new Error(response.message);

            const results = itemsSection.querySelector(
                ".page-section__results"
            );
            const tableData = itemsSection.querySelector(".table__body");
            tableData.innerHTML = "";

            items = [];

            if (response.items.length > 0) {
                results.classList.remove("page-section__results--no-results");

                const categories = [];

                response.items.forEach((item) => {
                    addItemToTable(item);
                    items.push(item);

                    if (categories.indexOf(item.category.name) === -1) {
                        categories.push(item.category.name);
                    }

                    currentItemId = Math.max(item.id, currentItemId);
                });

                itemFilters_category.innerHTML = `<option value="">Any</option>`;

                categories.sort().forEach((category) => {
                    const option = document.createElement("option");
                    option.setAttribute("value", category);
                    option.textContent = capitalize(category);
                    itemFilters_category.appendChild(option);
                });
            } else {
                results.classList.add("page-section__results--no-results");
            }
        })
        .catch((errorMsg) => {
            console.error(errorMsg);
            error("Items could not be loaded");
        });
}

