    addedValue.textContent = order.created_at;
    idHeadingCell.textContent = "ID";
    nameHeadingCell.textContent = "Name";
    quantityHeadingCell.textContent = "Quantity";
    supplementHeadingCell.textContent = "Supplement";
    acceptButton.textContent = "Accept";
    editButton.textContent = "Edit";
    rejectButton.textContent = "Reject";
    cancelButton.textContent = "Cancel";

    // Append child nodes
    ordersToValidateItems.appendChild(form);

    form.appendChild(idInputField);
    form.appendChild(orderData);
    form.appendChild(orderItems);
    form.appendChild(formOptions);

    orderData.appendChild(idElement);
    orderData.appendChild(tableElement);
    orderData.appendChild(guestsElement);
    orderData.appendChild(addedElement);

